    const { _id } = useParams();

    const axios = require('axios');
    axios.get('../../mock/userData.json', {
        params: {
            id: _id
        }
    }).then(function (response) {
        console.log(response);
        //const user = response.
    }).catch(function (error) {
        console.log(error);
    })

    return (
        <div className={Classes.title}>
            <h1>coucou</h1>
        </div>
    );
}

export default Title;
